var tipuesearch = {"pages": [{'title': 'About', 'text': '倉儲: https://github.com/40823245/cad2020 \n \n \n', 'tags': '', 'url': 'About.html'}, {'title': 'Work', 'text': '放上每周作業並更新、自評互評 \n', 'tags': '', 'url': 'Work.html'}, {'title': 'w1', 'text': '零件繪圖、建立網站、使用ssh \n', 'tags': '', 'url': 'w1.html'}, {'title': '零件(待更新)', 'text': 'pdf1:Solidworks2017使用1mm繪製 \n pdf2: Solidworks2017繪製(mm) \n \n pdf1 \n 1-10 \n \n 11-20 \n \n 21-30 \n \n 31-40 \n \n 41-50 \n \n pdf2 \n 件1 \n \n 件2 \n \n 件3-1 \n \n 件3-2 \n \n 件3-3 \n \n 件3-4 \n \n 件3-5 \n \n', 'tags': '', 'url': '零件(待更新).html'}, {'title': 'w2-w3', 'text': '零件繪製、表格製作、下載nx可攜版 \n nxopen_getting_started_v12.pdf \n', 'tags': '', 'url': 'w2-w3.html'}, {'title': 'w4-w6', 'text': '零件繪製(小組、個人)、下載課程使用程式、使用Zoomit \n', 'tags': '', 'url': 'w4-w6.html'}, {'title': 'HW2', 'text': '零件45 \n Solidworks2017使用10mm繪製 \n \n \n', 'tags': '', 'url': 'HW2.html'}, {'title': 'w7', 'text': '下載並使用tcc、零件繪圖(小組、個人) \n', 'tags': '', 'url': 'w7.html'}, {'title': 'tcc', 'text': '下載並修改路徑，所使用.c程式在白窗進行 \n 測試1: \n \n 測試2: \n \n', 'tags': '', 'url': 'tcc.html'}, {'title': 'w8', 'text': '零件繪圖(小組、個人)、tcc轉換(.c→.py)', 'tags': '', 'url': 'w8.html'}, {'title': 'tcc轉換', 'text': '將.c檔轉換成.py檔，並執行py檔 \n tcc -w -shared -DLIBTCC_AS_DLL -DONE_SOURCE multiply.c -o multiply.dll \n tcc -w -shared -DLIBTCC_AS_DLL -DONE_SOURCE multiply_float.c -o multiply_float.dll \n \n \n', 'tags': '', 'url': 'tcc轉換.html'}, {'title': '筆記', 'text': '一、開啟9443 \n \n 先打指令到cmsimde資料夾 \n 在執行python wsgi.py指令 \n 網址搜尋https://localhost:9443/ \n 或複製黑窗最後一行的網址 \n \n 案login登入→密碼admin \n 二、開啟8444 \n 先到scad2資料夾找到http-server.py檔案 \n \n 使用白窗開啟http-server.py \n 點選Tools→go \n \n 三、製作金鑰 \n 點選資料夾的Portablegit →bin→sh.exe \n \n 輸入ssh-keygen -t rsa -b 4096 -C "40823245" \n 請自行改成自己的學號 \n 案enter →輸入/y/tmp/id_rsa→案2次enter \n \n 下載 putty 、 putty_home 、 GitExtensions (請自行更改路徑) \n 將start移到白窗\xa0 並新增\xa0 \n set GIT_HOME=%Disk%:\\Portablegit\\bin\\\nset GIT_SSH=%Disk%:\\putty\\plink.exe \n \n \n 打開.git資料夾，把config移到白窗 \n 如沒有.git資料夾 打開隱藏的項目 \n \n 新增 [remote "origin"]裡的 url = git@github.com:40823245/cad2020.git \n \n file→save \n 打開putty資料夾的puttygen.exe \n 點load，找到id_rsa \n \n 案是→Save private key→案是→輸入學號(存.ppk檔) \n 打開putty.exe \n \n 若沒有github.com，在Host Name和Save Sessions打 github.com案Save \n \n 設定proxy(使用自家網路、手機網路請選None) \n 看你的網路連到哪一台 就打一樣的proxy \n \n 打開SSH裡面的Auth \n 選擇你所生產的金鑰檔案(.ppk) \n 回到session點選save再open \n \n 在home新增.ssh資料夾 \n ProxyCommand y:/putty/plink.exe github.com %h %p\n \nHost github.com\n    User git\n    Port 22\n    Hostname github.com\n \n    TCPKeepAlive yes\n    IdentitiesOnly yes\n\n \n \n 將上面的指令複製到白窗並另存config \n 到倉儲網頁新增金鑰(右上Settings) \n \n 點New SSH key \n 到tmp找到id_rsa.pub並用白窗開啟，複製內容到Key \n 並確認學號 \n \n \n 案Add SSH key \n 四、進行上傳 \n 方法一 \n 先進到scad2\xa0 →\xa0cd tmp/scad2 \n git add . \n git commit -m "此更新的主旨" \n git push \n 輸入帳號(學號) \n 輸入密碼 \n 方法二(啟用ssh) \n 要先改.git裡面的config \n [remote "origin"]把之前的https加上# \n \n 開啟putty(putty.exe)\xa0 \xa0將設定調好 \n 點github.com\xa0 案load \n 設定proxy(使用自家網路、手機網路請選None) \n 看你的網路連到哪一台 就打一樣的proxy \n 打開SSH裡面的Auth \n 選擇你所生產的金鑰檔案(.ppk) \n 回到session點選save再open \n \n 出現上圖就代表成功 \n 一樣先進到scad2\xa0 →\xa0cd tmp/scad2 \n git add . \n git commit -m "此更新的主旨" \n git push \n (此方法不需打帳號密碼) \n 方法三(啟用ssh) \n 使用資料夾的GitExtensions \n 點選GitExtensions.exe \n 修改設定 \n \n \n 確認正確以後\xa0 \xa0點OK \n 選擇Create new repository \n \n brown找到scad2資料夾後點Create \n 點tools→Git GUI \n \n 先點Stage Changed(=git add .) \n \n 案是 \n \n 案Continue \n \n 左下的框會出現資料 \n 然後右下的位置打上這次變更的主旨(= git commit -m "此更新的主旨" )可輸入中文 \n \n 點Commit→Push →Push \n \n 五、修改網頁標題 \n 打開資料夾找到init.py \n \n 使用白窗打開 \n \n 找到並修改成site_title = "學號 cad2020" \n file→save就可完成 \n 六、Zoomit \n 1、Ctrl+1:畫面放大+按下滑鼠進入畫畫模式( ESC能解除 ) \n 2、 Ctrl+2:進入畫畫模式(ESC能解除) \n 3、Ctrl+3:出現倒數的時間，休息時間剩多久(ESC能解除、Ctrl+3重置倒數時間) \n 4、 Ctrl+4:放大鏡(Ctrl+4 能解除) \n 5、畫畫模式:滑鼠直接畫任意線段、TAB+滑鼠滑動=畫圓、Shift+滑鼠滑動=畫直線 \n Ctrl+ 滑鼠滑動=畫矩形、Shift+Ctrl+滑鼠滑動=畫指線、Ctrl+T=打字 \n', 'tags': '', 'url': '筆記.html'}, {'title': '問題', 'text': '在倉儲github網站中，會發現少了downloads的資料夾 \n \n 需要做以下修改，並能解決問題 \n 將scad2裡的.gitignore裡面的downloads/刪除，並save \n \n 重新push後github就能有downloads了 \n \n 原因:gitignore會幫你忽視以下的檔案，為了防止他人能clone到你的某些檔案', 'tags': '', 'url': '問題.html'}]};